        return (userScaledBalance[account] * totalSupply) / totalScaledBalance;
    }

    /**
     * @dev Returns the allowance of spender on the tokens owned by owner
     * @param owner The owner of the tokens
     * @param spender The user allowed to spend the owner's tokens
     * @return The amount of owner's tokens spender is allowed to spend
     */
    function allowance(address owner, address spender)
        public
        view
        virtual
        override
        returns (uint256)
    {
        return _allowances[owner][spender];
    }

    /**
     * @dev Moves `amount` of tokens from `sender` to `recipient`.
     * @param sender The sender of the tokens
     * @param recipient The recipient of the tokens
     * @param amount The amount of tokens being transferred
     */
    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal virtual {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");

        uint256 senderBalance = balanceOf(sender);
        require(
            senderBalance >= amount,
            "ERC20: transfer amount exceeds balance"
        );
        // reverts on failure
        auditor.validateAccountShortfall(address(fixedLender), sender, amount);

        uint256 senderRemainingBalance = senderBalance - amount;
        userScaledBalance[sender] =
            (senderRemainingBalance * totalScaledBalance) /
            totalSupply;
        userScaledBalance[recipient] =
            ((balanceOf(recipient) + amount) * totalScaledBalance) /
            totalSupply;
        lastBalanceIncrease[recipient] = block.number;

        emit Transfer(sender, recipient, amount);
    }

    /**
     * @dev Sets `amount` as the allowance of `spender` over the `owner` s tokens.
     * @param owner The owner of the tokens
     * @param spender The user allowed to spend owner tokens
     * @param amount The amount of owner's tokens spender is allowed to spend
     */
    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) internal virtual {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }
}
